window.bookSummaryJSON = "<p><b>Sascha Dubois didn't think life could get much crazier, until, suddenly, it did.</b></p> <p>With the whole world knowing about her unusual household of seven – can't forget Tin – and&nbsp;everyone wanting a piece of her and her men, Veronia is an unanticipated haven.&nbsp;</p> <p>Within the confines of that kingdom, Sascha can come to terms with the new status quo, something she actually appreciates. Now, she can slap the cow who dares&nbsp;ogle Sawyer while he's jogging. And that actress who had her paws on Kurt? Yup, no more. Sascha's staked her claim.&nbsp;</p> <p>But life has never been able to cut the Quint family any slack. With wedding bells in the distant horizon, along with the pitter-patter of tiny feet, what can go wrong?</p> <p><i>Everything.&nbsp;</i></p>"; 
